import React from 'react';
import logo from './logo.svg';
import './App.css';
import Library from './Components/Library';

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      libs: {
        anime: {
          name: "anime",
          website: "https://animejs.com/",
          tags: ["anime", "animate", "animation", "lightweight"],
          description: "Lightweight JavaScript animation library, it works with CSS properties, SVG, DOM attributes and JavaScript Objects."
        },
        react: {
          website: "https://reactjs.org/",
          tags: ["desktop", "mobile", "interface"],
          description: "A JavaScript library for building user interfaces."
        },
        vue: {
          website: "https://vuejs.org/",
          tags: ["interface"],
          description: "The Progressive JavaScript Framework"
        },
      }
    }
  }



  render() {
    return (
      <div className="App">
        <table>
          <thead>
            <tr>
              <th scope="col">#</th>
                <th scope="col">Name</th>
                <th scope="col">Website</th>
                <th scope="col">Description</th>
                <th scope="col">Tags</th>
              </tr>
          </thead>
          <tbody>
            {this.state.libs.forEach(lib => {
              return <Library lib={lib} />
            })}
          </tbody>
        </table>
      </div>
    );
  }

}

export default App;
